import React from 'react';

const Note = ({ note, toggleImportance }) => {
  const label = note.important
    ? 'make not important' : 'make important'

  return (
    <li key={note.id}>
      {note.content}
      <button onClick={toggleImportance} className='note'>{label}</button>
    </li>
  );
};

export default Note;
